];

for (let i = 0; i < paths.length; i++) {
    let item = paths[i];

    try {
        let lastModified;
        try {
            lastModified = lastWrite(item.path);
        } catch (error) {
            log("Path does not exist or cannot be accessed: " + item.path);
            continue;
        }

        if (item.type === "folder") {
            if (lastModified > time() - 86400) {
                result(item.name + " folder was recently modified!", warning);
                log("Recent modification detected in " + item.name + ": " + item.path);
            }
        }

        if (item.type === "file") {
            let files;
            try {
                files = walk(item.path);
            } catch (error) {
                log("Error walking path: " + item.path + " | " + error.message);
                continue;
            }

            if (!files || files.length === 0) {
                log("No files found in: " + item.path);
                continue;
            }

            for (let j = 0; j < files.length; j++) {
                let file = files[j];

                if (item.file_ext && file.endsWith(item.file_ext)) {
                    result("Macro file found at " + item.name + ": " + file, warning);
                    log("Detected macro file: " + file);
                }

                if (item.file && file.endsWith(item.file)) {
                    let fileModified = lastWrite(file);
                    if (fileModified > time() - 86400) {
                        result(item.name + " file was modified recently: " + file, warning);
                        log("Modification detected: " + file);
                    }
                }

                if (item.contains) {
                    let content;
                    try {
                        content = file(file);
                    } catch (error) {
                        log("Error reading file: " + file + " | " + error.message);
                        continue;
                    }

                    if (content && content.includes(item.contains)) {
                        result("Macro setting found in " + item.name + ": " + file, severe);
                        log("Detected suspicious setting in: " + file);
                    }
                }
            }
        }
    } catch (error) {
        log("Error processing " + item.name + ": " + error.message);
    }
}

