const tasks_path = `C:/Windows/System32/Tasks`;
const windows_username = currentUserFolder.split("/").pop();
const yara_rules = file("tasks.yara").replace("%%%USERNAME%%%", windows_username);
const jrl = journal();
const currentTime = Date.now();
const detection_threshold = 16

let count = 0;
let structure = {};
let debug_array = [];
let task_modifications = {};
let detection_scores = {};
let detection_results = [];
let score_debug_array = []

const rule_scores = {
    "task_enabled": 1,
    "task_author_user": 10,
    "task_author_system": 0,
    "task_perm_highest": 3,
    "task_perm_lowest": 0,
    "task_command_cmd": 3,
    "task_command_exe": 2,
    "task_command_bat": 2,
    "task_command_dot_cmd": 2,
    "task_command_ps1": 3,
    "task_argument": 1,
    "task_working_directory": 1,
    "task_hidden": 3,
    "task_runs_on_logon": 2,
    "task_in_windows_namespace": 2,
    "task_runs_as_admin_account": 3,
    "task_execution_time_limit_extended": 2,
    "task_context_author": 1
};

function timeAgo(milliseconds) {
    let seconds = Math.floor(milliseconds / 1000);
    let minutes = Math.floor(seconds / 60);
    let hours = Math.floor(minutes / 60);
    let days = Math.floor(hours / 24);
    if (days > 0) return `${days}d ago`;
    if (hours > 0) return `${hours}h ago`;
    if (minutes > 0) return `${minutes}m ago`;
    return `${seconds}s ago`;
}

walk(tasks_path, task_path => {
    count++;

    let relative = task_path.substring(tasks_path.length + 1);
    let parts = relative.split('\\');
    let current = structure;
    for (let i = 0; i < parts.length; i++) {
        let part = parts[i];
        if (i === parts.length - 1) {
            current[part] = task_path;
        } else {
            if (!current[part]) current[part] = {};
            current = current[part];
        }
    }

    let matched_rules = yara(task_path, yara_rules);

    let score = 0;

    matched_rules.forEach(rule => {
        if (rule_scores[rule]) {
            score += rule_scores[rule];
        }
    });

    detection_scores[task_path] = {
        task: task_path,
        score: score,
        matches: matched_rules
    };

    if (score >= detection_threshold) {
        detection_results.push({
            task: task_path,
            score: score,
            created_at: timeAgo(currentTime - createdAt(task_path)*1000),
            edited_at: timeAgo(currentTime - lastWrite(task_path)*1000),
            matches: matched_rules
        });
    }
});


jrl.forEach(entry => {
    if (entry.path.includes("C:/Windows/System32/Tasks") && entry.reason !== "data_change") {
        let task_name = entry.path.split("/").pop();
        if (entry.reason === "created" || entry.reason === "deleted") {
            task_modifications[task_name] = {
                task_name: task_name,
                task_path: entry.path,
                event_time: timeAgo(currentTime - entry.timestamp * 1000),
                reason: entry.reason
            };
        }
        debug_array.push(`${entry.path} @ ${entry.reason} | ${timeAgo(currentTime - entry.timestamp * 1000)} (${entry.timestamp})`);
    }
});

// Output
log("Found task scheduler entries: " + count);
log("Detected suspicious (cheat/bypass) tasks: " + detection_results.length);
detection_results.forEach(result => {
    log(`[BYPASS] ${result.task} | Created: ${result.created_at} Last edited: ${result.edited_at} => Score: ${result.score}, Rules: ${result.matches.join(', ')}`);
});

log("\nTask modifications:");
log(task_modifications);

log("\n----------------------- DEBUG: ALL TASK SCORES -----------------------");
Object.values(detection_scores)
    .sort((a, b) => b.score - a.score)
    .forEach(entry => {
        score_debug_array.push(`[SCORE ${entry.score}] ${entry.task} -> Matches: ${entry.matches.join(', ')}`);
    });
log(score_debug_array)

log("\n----------------------- DEBUG (journal events) -----------------------");
log(debug_array);

let executables = amcache();
let journalEntries = journal();

// Build map: { baseExeName (lowercased) -> { fullPath: original path, baseName: original base name } }
let exeMap = {};
executables.forEach(entry => {
    if (entry.file_name && entry.file_name.toLowerCase().endsWith(".exe")) {
        let baseName = entry.file_name.slice(0, -4); // REMOVE '.exe', KEEP original case for dll matching
        exeMap[baseName.toLowerCase()] = { fullPath: entry.path, baseName: baseName };
    }
});

// Preprocess journal entries for faster lookup
let dllChanges = {};   // { normalizedPath (lowercase + /) -> [{originalPath, timestamp}] }
let configChanges = {}; // { normalizedFolderPath (lowercase + /) -> [{originalPath, timestamp}] }

journalEntries.forEach(entry => {
    let originalPath = entry.path;
    let normalizedPath = originalPath.replaceAll("\\", "/").toLowerCase();
    let reason = entry.reason;

    if (reason === "data_change") {
        if (normalizedPath.endsWith(".dll")) {
            if (!dllChanges[normalizedPath]) dllChanges[normalizedPath] = [];
            dllChanges[normalizedPath].push({ originalPath: originalPath, timestamp: entry.timestamp });
        } else {
            let fileName = normalizedPath.split("/").pop();
            if (!fileName.includes(".")) { // No extension = config
                let folder = normalizedPath.substring(0, normalizedPath.lastIndexOf("/") + 1);
                if (!configChanges[folder]) configChanges[folder] = [];
                configChanges[folder].push({ originalPath: originalPath, timestamp: entry.timestamp });
            }
        }
    }
});

// Scan exe -> dll -> config
let suspiciousMatches = [];
const TIME_WINDOW = 10; // 10 seconds tolerance

for (let baseNameLower in exeMap) {
    let { fullPath: exePathOriginal, baseName } = exeMap[baseNameLower];

    let exePathNormalized = exePathOriginal.toLowerCase().replaceAll("\\", "/");
    let folderOriginal = exePathOriginal.substring(0, exePathOriginal.lastIndexOf("\\") + 1);
    let folderNormalized = folderOriginal.toLowerCase().replaceAll("\\", "/");

    let dllPathOriginal = folderOriginal + baseName + ".dll";
    let dllPathNormalized = dllPathOriginal.toLowerCase().replaceAll("\\", "/");


    if (dllChanges[dllPathNormalized]) {
        // Found .dll with data_change
        dllChanges[dllPathNormalized].forEach(dllEntry => {
            let dllTimestamp = dllEntry.timestamp;

            if (configChanges[folderNormalized]) {
                let configsNearby = configChanges[folderNormalized].filter(config => {
                    return Math.abs(config.timestamp - dllTimestamp) <= TIME_WINDOW;
                });

                if (configsNearby.length > 0) {
                    suspiciousMatches.push({
                        exe: exePathOriginal,
                        dll: dllEntry.originalPath,
                        dllTimestamp: dllTimestamp,
                        configs: configsNearby.map(c => c.originalPath)
                    });
                }
            }
        });
    }
}

// Output results
if (suspiciousMatches.length > 0) {
    log("🚨 Suspicious cheat-like behavior detected!");

    // Deduplicate executable names using a Set
    let uniqueExecutables = new Set();

    suspiciousMatches.forEach(match => {
        uniqueExecutables.add(match.exe);
    });

    // Log all unique executables
    uniqueExecutables.forEach(exe => {
        let hyper_filename = exe.split("\\").pop()
        result(`Skript [AF] @ [[${hyper_filename}]]`, severe);
    });

    // Log DLLs, config changes, and timestamps
    suspiciousMatches.forEach(match => {
        log(`Executable: ${match.exe}`);
        log(`DLL changed: ${match.dll}`);
        log(`Config file(s) changed: ${match.configs.join(", ")}`);
        log(`DLL Timestamp: ${match.dllTimestamp}`);
    });
}


